import React from 'react'

import styled from 'styled-components'

const Modal = styled.div`
	width: 100vw;
	height: 100vh;
	background: rgba(0, 0, 0, 0.3);
	z-index: 3;
	position: relative;
`

const ModalCard = styled.div`
	width: 40%;
	position: absolute;
	top: 20%;
	left: 50%;
`

const ConfirmModal = () => {
	return (
		<Modal>
			<ModalCard>Hi modal</ModalCard>
		</Modal>
	)
}

export default ConfirmModal
